import React from "react";
import ReactDOM from "react-dom";

function Card(){
  return (
    <>
    <div className="cards">
      <div className="card">
        <img src="https://www.inspirationde.com/media/2020/07/dark-season-concept-keyart-on-behance-15946476138nk4g.png" 
        alt="mypic" className="card-img" />
        <div className="card-info">
          <span className="card-catagory"> A Netflix Orignal Series </span>
          <h3 className="card-title"> DARK </h3>
          <a href="https://www.netflix.com/in/title/80100172" 
             target="_blank">
            <button> Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  </>
  )
}

ReactDOM.render(
    <Card />
  ,document.getElementById('root')
);
